import React, { useState } from "react";
import digital from "../../assests/marketing-icon.webp";
import design_icon from "../../assests/icons/clipboard.png";
import website_icon from "../../assests/icons/device-laptop.png";
import mobile_icon from "../../assests/icons/device-tablet.png";
import search_icon from "../../assests/icons/search.png";
import social_media_icon from "../../assests/icons/brand-twitter.png";
import content_icon from "../../assests/icons/edit.png"; // assuming separate icon from digital

const ThingsWeAreGoodAt = () => {
  const [activeTab, setActiveTab] = useState("Digital Strategy");

  const tabs = [
    {
      name: "Digital Strategy",
      icon: digital,
    },
    {
      name: "Design",
      icon: design_icon,
    },
    {
      name: "Web",
      icon: website_icon,
    },
    {
      name: "Mobile",
      icon: mobile_icon,
    },
    {
      name: "Social Media",
      icon: social_media_icon,
    },
    {
      name: "SEO",
      icon: search_icon,
    },
    {
      name: "Content Writing",
      icon: content_icon,
    },
  ];

  const renderContent = (tabName) => {
    switch (tabName) {
      case "Digital Strategy":
        return (
          <div className="flex flex-col">
            <strong>Digital Strategy</strong>
            <div className="flex">
              <img src={digital} alt="digital_strategy" />
              <p className="flex justify-left w-1/2">
                We provide our phenomenal services at a global level...
              </p>
            </div>
          </div>
        );
      case "Design":
        return (
          <div className="flex flex-col">
            <strong>Design</strong>
            <div className="flex">
              <img src={design_icon} alt="design" />
              <p className="flex justify-left w-1/2">
                We establish brands that are fascinating...
              </p>
            </div>
          </div>
        );
      case "Web":
        return (
          <div className="flex flex-col">
            <strong>Web:</strong>
            <div className="flex">
              <img src={website_icon} alt="web" />
              <p className="flex justify-left w-1/2">
                We provide you with a web strategy...
              </p>
            </div>
          </div>
        );
      case "Mobile":
        return (
          <div className="flex flex-col">
            <strong>Mobile:</strong>
            <div className="flex gap-5">
              <img src={mobile_icon} alt="mobile" />
              <p className="flex justify-left w-1/2">
                We are here to develop websites for mobile phones and tablets...
              </p>
            </div>
          </div>
        );
      case "Social Media":
        return (
          <div className="flex flex-col">
            <strong>Social Media:</strong>
            <div className="flex">
              <img src={social_media_icon} alt="social media" />
              <p className="flex justify-left w-1/2">
                We provide a social media strategy...
              </p>
            </div>
          </div>
        );
      case "SEO":
        return (
          <div className="flex flex-col">
            <strong>SEO:</strong>
            <div className="flex gap-5">
              <img src={search_icon} alt="SEO" />
              <p className="flex justify-left w-1/2">
                We optimize your website for search engines...
              </p>
            </div>
          </div>
        );
      case "Content Writing":
        return (
          <div className="flex flex-col">
            <strong className="w-1/2">Content Writing:</strong>
            <div className="flex gap-5">
              <img src={content_icon} alt="content writing" />
              <p className="flex justify-left w-1/2">
                We create quality content your audience will love...
              </p>
            </div>
          </div>
        );
      default:
        return null;
    }
  };

  return (
    <div className="flex justify-center items-center flex-col w-full max-w-[1300px] mx-auto p-4 shadow-[0px_5px_15px_rgba(0,0,0,0.35)]">
      <h1 className="text-[72px] py-5 mb-6">Things We Are Good at</h1>

      {/* Mobile Dropdown */}
      <select
        className="sm:hidden border px-3 py-2 rounded-md mb-4"
        value={activeTab}
        onChange={(e) => setActiveTab(e.target.value)}
      >
        {tabs.map((tab) => (
          <option key={tab.name} value={tab.name}>
            {tab.name}
          </option>
        ))}
      </select>

      {/* Dot Indicators */}
      <div className="flex gap-2 mt-2 mb-6">
        {tabs.map((tab) => (
          <span
            key={tab.name}
            onClick={() => setActiveTab(tab.name)}
            className={`w-3 h-3 rounded-full cursor-pointer transition-all duration-200 ${
              activeTab === tab.name ? "bg-blue-600 scale-110" : "bg-gray-300"
            }`}
          />
        ))}
      </div>

      {/* Tab Content */}
      <div className="py-10 text-gray-700 text-center max-w-xl min-h-[100px]">
        {renderContent(activeTab)}
      </div>

      {/* Desktop Tab Buttons with Icon */}
      <div className="hidden sm:flex border-b w-full justify-center gap-1 mb-6">
        {tabs.map((tab) => (
          <button
            key={tab.name}
            onClick={() => setActiveTab(tab.name)}
            className={`flex items-center gap-2 py-[14px] px-[20px] font-medium transition-all ${
              activeTab === tab.name
                ? "border-blue-500 bg-[#F8F8F8] text-[#666666]"
                : "border-transparent bg-[#125D93] text-white hover:text-blue-500"
            }`}
          >
            <img src={tab.icon} alt={tab.name} className="text w-5 h-5" />
            {tab.name}
          </button>
        ))}
      </div>
    </div>
  );
};

export default ThingsWeAreGoodAt;
